import React, { useState } from 'react'

const Piece = props => {
    const [currX, setCurrX] = useState(props.x);
    const [currY, setCurrY] = useState(props.y);

    return (
        <div style={{position:'absolute', left:`${{currX} * 16}%`, top:`${{currY} * 16}%`, backgroundColor:'red'}}>
            Piece
        </div>
    )
}

export default Piece;
